import React from 'react';


class UsersPage extends React.Component{
        constructor(props){
          super(props);
          this.state = {users: []};
        }
        componentDidMount(){
          axios.get('https://jsonplaceholder.typicode.com/todos/1').then((result)=>this.setState({
            users: result.data
          }))
        }

    }

    export default UsersPage;
